import Loadable from 'app/components/Loadable';
import { lazy } from 'react';
import { authRoles } from '../../auth/authRoles';

const AdminAnalytics = Loadable(lazy(() => import('../admin/AdminAnalytics')));
const HospitalAnalytics = Loadable(lazy(() => import('./HospitalAnalytics')));
const ServiceProviderAnalytics = Loadable(lazy(() => import('./ServiceProviderAnalytics')));

const dashboardRoutes = [
  { path: '/dashboard/admin', element: <AdminAnalytics />, auth: authRoles.admin },
  { path: '/dashboard/hospital', element: <HospitalAnalytics />, auth: authRoles.hospital },
  { path: '/dashboard/service-provider', element: <ServiceProviderAnalytics />, auth: authRoles.sp },
];

export default dashboardRoutes;
